description:
Want is the second studio album by Colorado electronic duo 3OH!3. It is their first album with record label Photo Finish. The album was produced by award-winning producer Matt Squire. Songs from the album were played at the annual Bamboozle music festival in 2008. The track &quot;Punkbitch&quot; was included on the Warped Tour 2008 Tour Compilation.

The first single from the album was &quot;Don't Trust Me&quot;. The second single was &quot;Starstrukk&quot; which was released on June 8, 2009. A remix version featuring Katy Perry was released as a single on September 8, 2009.

